  console.log('first', codeBlocks[0]);  
  if (!Array.isArray(codeBlocks)) {
    return <div>Error: codeBlocks is not an array. Received: {JSON.stringify(codeBlocks)}</div>;
  }
  return (
    <div className="lobby-page">
      <div>
        <h1>Choose Code Block</h1>
        <ul>
        </ul>
      </div>
    </div>
  );
}
